import React from 'react';
import ReactDOM from 'react-dom';
import Notepad from './components/notepad';
import './App.css';
import {
  Route,
  Switch,
  Redirect,
  BrowserRouter as Router,
} from "react-router-dom";

export default function App() {
  return (
    <Router>
       <div>
         <Switch>
            <Route exact path="/">
              < Notepad />
            </Route>
            <Route exact path="/login">
              <Redirect to="/login" />
            </Route>

         </Switch>
       </div>
    </Router>
  );
}
